import React from "react";
import users from '../data/users'
// fetch('../data/users.json')
// .then()
// .then()
// .catch(error => {
//     console.log(error);
// });
function Info(){
    return (
       users.map((data)=>
            <div className="row">
              <div className="col">
               <h2>
                Name :  {data.name} <br />
                Id : {data.id} <br />
                Email : {data.email} <br />
                Age : {data.age} <br />
                Address : City -{data.address.city}
               </h2>
              </div>
            </div>
       )
    );
}

export default Info;
